Files containing the handler implementation:
- app/Http/Controllers/Api/V1/UserPostController.php

Explanation and how I found it:
- The project's routes/api.php registers the route Route::apiResource('users.posts', UserPostController::class)->only('index'), which maps GET /v1/users/{user}/posts to App\Http\Controllers\Api\V1\UserPostController@index.
- I searched the codebase for the controller class and opened the file app/Http/Controllers/Api/V1/UserPostController.php. It contains the index method implementation:
  public function index(Request $request, User $user): ResourceCollection
  {
      return PostResource::collection(
          $user->posts()->latest()->paginate($request->input('limit', 20))
      );
  }
- This is the sole implementation of that controller in the codebase (no duplicate handlers were found). The method returns a paginated collection of the user's posts wrapped in the PostResource.
